graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Secure Application</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Home" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Home</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Homepage</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "SecureArea" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>SecureArea</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Secure Area</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Logout" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Logout</b> <i>&lt;state&gt;</i></td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "LoginForm" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoginForm</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "LoginSuccess" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoginSuccess</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "CreateSession" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CreateSession</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ValidateSession" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ValidateSession</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Home" -> "LoginForm" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "LoginForm" -> "LoginSuccess" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "LoginSuccess" -> "CreateSession" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "CreateSession" -> "SecureArea" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "SecureArea" -> "ValidateSession" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ValidateSession" -> "SecureArea" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "SecureArea" -> "Logout" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
